import './App.css';
import Navbar from './components/Navbar.js';
import { BrowserRouter as Router, Switch, Route} from 'react-router-dom';
import React from 'react';
import GaugeChart from 'react-gauge-chart'
import Collapsible from 'react-collapsible';
import EquipmentManager from './components/EquipmentSorting/EquipmentManager'

const App = () => {
  return (
    <div className="App">
      <h1>Hello</h1>
      <div className= "weatherContainer" pt-3 pb-3>
        <WeatherBody day = {'Mon'} icon={'Sun'} minTemp = {15} maxTemp={25} />
      </div>
      <Collapsible trigger="Recommended Equipment">
      <EquipmentManager />
      <div className="wrapper">
    </div>
  )
      </Collapsible>
      <GaugeChart id="gauge-chart1"/>
    </div>
  );
}



export default App;
